import PDFTemplate from "pdfmake";
export default {
  user: null,
  data: [],
  getData(data) {
    this.data = data;
  },
  getUser(user) {
    this.user = user;
  },
  template() {
    var retrieve = [];
    retrieve.push([
      {
        text: "JOB TITLE",
        bold: true,
        alignment: "center",
        fontSize: 10,
        color: "#e62d7e",
        borderColor: ["#e62d7e", "#e62d7e", "#e62d7e", "#e62d7e"],
      },
      {
        text: "DATE",
        bold: true,
        alignment: "center",
        fontSize: 10,
        color: "#e62d7e",
        borderColor: ["#e62d7e", "#e62d7e", "#e62d7e", "#e62d7e"],
      },
      {
        text: "HELPA NAME",
        bold: true,
        alignment: "center",
        fontSize: 10,
        color: "#e62d7e",
        borderColor: ["#e62d7e", "#e62d7e", "#e62d7e", "#e62d7e"],
      },
      {
        text: "PAID",
        bold: true,
        alignment: "center",
        fontSize: 10,
        color: "#e62d7e",
        borderColor: ["#e62d7e", "#e62d7e", "#e62d7e", "#e62d7e"],
      },
    ]);

    if (this.data && this.data.length > 0) {
      for (let index = 0; index < this.data.length; index++) {
        retrieve.push([
          {
            text:
              this.data[index].title !== undefined
                ? this.data[index].title
                : "N/A",
            fontSize: 10,
            alignment: "center",
            margin: [0, 5],
            borderColor: ["#D3D3D3", "#D3D3D3", "#D3D3D3", "#D3D3D3"],
          },
          {
            text:
              this.data[index].created_at !== undefined
                ? this.data[index].created_at
                : "N/A",
            fontSize: 10,
            alignment: "center",
            margin: [0, 5],
            borderColor: ["#D3D3D3", "#D3D3D3", "#D3D3D3", "#D3D3D3"],
          },
          {
            text:
              this.data[index].freelancer !== undefined
                ? this.data[index].freelancer
                : "N/A",
            fontSize: 10,
            alignment: "center",
            margin: [0, 5],
            borderColor: ["#D3D3D3", "#D3D3D3", "#D3D3D3", "#D3D3D3"],
          },
          {
            text:
              this.data[index].paid !== undefined
                ? this.data[index].paid
                : "N/A",
            fontSize: 10,
            alignment: "center",
            margin: [0, 5],
            borderColor: ["#D3D3D3", "#D3D3D3", "#D3D3D3", "#D3D3D3"],
          },
        ]);
      }
    }

    var docDefinition = {
      pageMargins: [40, 0, 40, 60],
      pageSize: "A4",
      content: [
        {
          image:
            "data:image/png;base64,",
          width: 600,
          alignment: "center",
          margin: [0, 0, 0, -20],
        },
        {
          text: [
            { text: "Name:         ", bold: true },
            {
              text:
                this.user !== null
                  ? this.user.information.first_name +
                    " " +
                    this.user.information.last_name
                  : "No name",
              bold: true,
            },
          ],
          fontSize: 12,
          style: "subheader",
          alignment: "left",
          margin: [0, 0, 0, 5],
        },
        {
          text: [
            { text: "Email:          ", bold: true },
            {
              text: this.user !== null ? this.user.email : "No Email",
              bold: true,
            },
          ],
          fontSize: 12,
          style: "subheader",
          alignment: "left",
          margin: [0, 0, 0, 20],
        },
        {
          columns: [
            {
              style: "tableExample",
              table: {
                widths: ["*", "*", "*", "*"],
                alignment: "left",
                body: retrieve,
              },
              layout: "lightHorizontalLines",
            },
          ],
        },
      ],
    };
    PDFTemplate.createPdf(docDefinition).download("Reports.pdf");
  },
};
